import React from "react";

// Importing the Bootstrap CSS 
import "bootstrap/dist/css/bootstrap.min.css";
import "./app-styles.css"

// Importing React Router
import { BrowserRouter, Route } from "react-router-dom";

import Header from "../components/structure/Header";
import Footer from "../components/structure/Footer_2";
import ImageImport from "../components/structure/ImageImport";
import Aktuelles from "./Akutelles/Aktuelles";
import Termine from "./Akutelles/Termine";
import Oeffnungszeiten from "./Akutelles/Oeffnungszeiten"; 



function App() {
  return (
    <div>
      <Header />
      <ImageImport 
        img= "/img/Startbild.png"
        alt= "Startbild"
        className = "titleimage"
      />
      <Route path="/" exact render={() => <h1>Home</h1>} />
      <Aktuelles />
      <Termine />
      <Oeffnungszeiten />
      <Footer />


    </div>
  );
}

export default App;
